@t32_beforeBold:='</w:t></w:r><w:r><w:t xml:space="preserve"> </w:t></w:r><w:r><w:rPr><w:b/></w:rPr><w:t xml:space="preserve">',

@t32_beforeBoldWhiteSpace:='</w:t></w:r><w:r></w:r><w:r><w:rPr><w:b/></w:rPr><w:t>',
   
@t32_afterBold:='</w:t></w:r><w:r><w:t xml:space="preserve">';


SET SESSION group_concat_max_len = 10000000;


select @t32_preface

UNION 
(select * from
(select
concat(
@t32_before_mentor,
@t32_mentor:=concat(e.lastName,', ',e.firstName,ifnull(concat(' ',e.middleName),''),' (',e.mentor_personID,')'),
@t32_after_mentor_before_mentee,
@t32_mentee:=concat(f.lastName,', ',f.firstName,ifnull(concat(' ',f.middleName),''),' (',f.mentee_personID,')'),
@t32_after_mentee_before_status,

pastCurrent,

@t32_after_status_before_training_period,

years,

@t32_after_training_period_before_citation,

/* Optional: The commented code in the below case statement allows you to group together citations in a single cell. */

case
    when c.citation is not null and c.authorListEtAl not like('{%') then /*group_concat(distinct*/ concat(
        replace(replace(c.authorListEtAl,'{',@t32_beforeBold),'}',@t32_afterBold),' ',
        replace(replace(c.citation,'<','&lt;'),'>','&gt;')) /*order by citation asc separator '<w:br/><w:br/>' )*/
    when c.citation is not null and c.authorListEtAl like('{%') then /*group_concat(distinct*/ concat(
        replace(replace(c.authorListEtAl,'{',@t32_beforeBoldWhiteSpace),'}',@t32_afterBold),' ',
        replace(replace(c.citation,'<','&lt;'),'>','&gt;')) /*order by citation asc separator '<w:br/><w:br/>' )*/
    else 'No publications'
end,    

@t32_after_citation_before_row_end)

from T32demo_grants g
left join T32demo_mentors_mentees m on m.mentor_personID = g.mentor_personID
join T32demo_mentors e on e.mentor_personID = g.mentor_personID
left join T32demo_mentees f on f.mentee_personID = m.mentee_personID
left join T32demo_citation c on c.personID = f.mentee_personID 


/* Select the grant ID. Here's the one parameter you need to update */
where grant_id = '1'

/* Optional: include the below only to only retrieve publications where both mentor and mentee are co-authors */

/* and c.pmid in (select pmid from T32demo_citation x inner join T32demo_mentors k on k.mentor_personID = x.personID)  */

/* Optional: uncomment the below line if you want publications to be grouped in the same cell */
/* group by e.mentor_personID, f.mentee_personID */
order by e.lastName, f.lastName asc) h)


UNION 

select @t32_remainder

order by @t32_mentor, @t32_mentee
;
